export default {
  props: ['question'],
  emits: ['confirm', 'cancel'],
  setup(__props, { expose, emit }) {
  expose();

const props = __props

  
  

const __returned__ = { props, emit }
Object.defineProperty(__returned__, '__isScriptSetup', { enumerable: false, value: true })
return __returned__
}

}
